import React, {Component} from "react";
import axios from "axios"


class Zillow extends Component {

  state = {
    results: []
  }

  componentDidMount() {
   var req = unirest("GET", "https://movie-database-imdb-alternative.p.rapidapi.com/");

req.query({
	"page": "1",
	"r": "json",
	"s": "Avengers Endgame"
});

req.headers({
	"x-rapidapi-host": "movie-database-imdb-alternative.p.rapidapi.com",
	"x-rapidapi-key": "41f3f91b13mshaa0652a8c3b96f1p165abcjsn42e270cab71c",
	"useQueryString": true
});


req.end(function (res) {
	if (res.error) throw new Error(res.error);

	console.log(res.body);
});
  }

  render() {
    return <ul>
        {this.state.results.map((result) => <li>{result.data.name}</li>)}
      </ul>

  }
}

export default Zillow;
